var UserManagement=function(){let n=$("#usersTable");var t=null,i=i=>{t=new DataTable(n,i),t.init([{data:"id",visible:!1},{data:"userName",title:"User Name"},{data:"email",title:"Email"},{data:"firstName",title:"First Name"},{data:"lastName",title:"Last Name"},{data:"role",title:"User Role"},{data:"id",render:function(n,t,i){let r=`<a class="btn btn-primary ladda-button" data-style="slide-left" href="/UserManagement/Details/${n}">Edit</a>`;return i.role!=="Administrator"&&(r+=`<button class="ladda-button btn btn-danger" data-style="slide-left" style="margin-left:5px;" data-id="${n}">Delete</button>`),r}}])};n.on("click",".btn-danger",function(){var n=$(this).data("id");$.ajax({url:"/UserManagement/Delete/",type:"Post",data:{id:n},success:function(){window.location.reload()}})});return{init:i}}();